>\r\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" height=\"100%\" width=\"100%\" id=\"bodyTable\" style=\"border-collapse:collapse; margin:0; padding:0; background-color:#F2F2F2; height:100%!important; width:100%!important\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"top\" id=\"bodyCell\" style=\"margin:0; padding:0; border-top:0; height:100%!important; width:100%!important\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"top\" style=\"\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templatePreheader\" style=\"border-collapse:collapse; background-color:#FFFFFF; border-top:0; border-bottom:0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"top\" style=\"\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\" class=\"templateContainer\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"preheaderContainer\" style=\"padding-top:9px\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextBlockInner\" style=\"padding-top:9px\">\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextContentContainer\" style=\"max-width:390px; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"padding:0px 18px 9px; color:#777070; font-family:&quot;Lucida Sans Unicode&quot;,&quot;Lucida Grande&quot;,sans-serif; font-size:11px; font-weight:normal; line-height:100%; text-align:left\">\r\nCronofy - July 2017 </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextContentContainer\" style=\"max-width:210px; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"padding:0px 18px 9px; color:#777070; font-family:&quot;Lucida Sans Unicode&quot;,&quot;Lucida Grande&quot;,sans-serif; font-size:11px; font-weight:normal; line-height:100%; text-align:left\">\r\n<a href=\"http://mailchi.mp/cronofy/exciting-new-feature-build-scheduling-into-your-application-with-real-time-scheduling?e=edda950f1d\" target=\"_blank\" style=\"word-wrap:break-word; color:#606060; font-weight:normal; text-decoration:underline\">View this email\r\n in your browser</a> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" valign=\"top\" style=\"\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateHeader\" style=\"border-collapse:collapse; background-color:#FFFFFF; border-top:0; border-bottom:0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"top\" style=\"\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\" class=\"templateContainer\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"headerContainer\" style=\"padding-top:10px; padding-bottom:10px\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnImageBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnImageBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" class=\"mcnImageBlockInner\" style=\"padding:9px\">\r\n<table align=\"left\" width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageContentContainer\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnImageContent\" valign=\"top\" style=\"padding-right:9px; padding-left:9px; padding-top:0; padding-bottom:0\">\r\n<img align=\"left\" alt=\"\" src=\"https://gallery.mailchimp.com/1557eba245366dbf2346b5390/images/e7f11f83-6759-46a9-9dac-fe823e3e9330.jpg\" width=\"564.0000305175781\" class=\"mcnImage\" style=\"max-width:899px; padding-bottom:0; display:inline!important; vertical-align:bottom; border:0; outline:none; text-decoration:none\">\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextBlockInner\" style=\"padding-top:9px\">\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextContentContainer\" style=\"max-width:100%; min-width:100%; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"padding:0px 18px 9px; color:#777070; font-family:&quot;Lucida Sans Unicode&quot;,&quot;Lucida Grande&quot;,sans-serif; font-size:16px; font-weight:normal; line-height:150%; text-align:left\">\r\n<h2 class=\"null\" style=\"text-align:center; margin:0; padding:0; display:block; font-family:Helvetica; font-size:26px; font-style:normal; font-weight:bold; line-height:125%; letter-spacing:-.75px; color:#404040!important\">\r\nHello karl</h2>\r\n<br>\r\nWe're excited to give you a sneak-peek at our&nbsp;<a href=\"http://cronofy.us7.list-manage.com/track/click?u=1557eba245366dbf2346b5390&amp;id=0040900823&amp;e=edda950f1d\" target=\"_blank\" style=\"word-wrap:break-word; color:#6DC6DD; font-weight:normal; text-decoration:underline\">Real-Time\r\n Scheduling</a>&nbsp;feature. It leverages our Availabilty API to help you build scheduling into your applications.<br>\r\n<br>\r\nIn the video below, fictional company Globex is using Real-Time Scheduling to help recruiters organize interview times with candidates.<br>\r\n&nbsp; </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnImageCardBlock\" style=\"border-collapse:collapse\">\r\n<tbody class=\"mcnImageCardBlockOuter\">\r\n<tr>\r\n<td class=\"mcnImageCardBlockInner\" valign=\"top\" style=\"padding-top:9px; padding-right:18px; padding-bottom:9px; padding-left:18px\">\r\n<table align=\"right\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageCardBottomContent\" width=\"100%\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnImageCardBottomImageContent\" align=\"left\" valign=\"top\" style=\"padding-top:0px; padding-right:0px; padding-bottom:0; padding-left:0px\">\r\n<a href=\"http://cronofy.us7.list-manage.com/track/click?u=1557eba245366dbf2346b5390&amp;id=13b85ea753&amp;e=edda950f1d\" title=\"\" class=\"\" target=\"\" style=\"word-wrap:break-word\"><img alt=\"\" src=\"https://gallery.mailchimp.com/video_thumbnails_new/9b3bb0e890c5a03cb58d073141ad3314.png\" width=\"564\" class=\"mcnImage\" style=\"max-width:640px; border:0; outline:none; text-decoration:none; vertical-align:bottom\">\r\n</a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"mcnTextContent\" valign=\"top\" width=\"546\" style=\"padding:9px 18px; color:#F2F2F2; font-family:Helvetica; font-size:14px; font-weight:normal; text-align:center; line-height:150%\">\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextBlockInner\" style=\"padding-top:9px\">\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextContentContainer\" style=\"max-width:100%; min-width:100%; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"padding:0px 18px 9px; color:#777070; font-family:&quot;Lucida Sans Unicode&quot;,&quot;Lucida Grande&quot;,sans-serif; font-size:16px; font-weight:normal; line-height:150%; text-align:left\">\r\nThis feature is popular in HR as it helps recruiters schedule interviews, but it can be used in a range of scenarios.<br>\r\n<br>\r\nWhether it's medical appointments, property viewings, or sales meetings, if you need to arrange an event between busy users – no matter what calendar service they use – Cronofy can help.<br>\r\n&nbsp; </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnButtonBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnButtonBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" align=\"center\" class=\"mcnButtonBlockInner\" style=\"padding-top:0; padding-right:18px; padding-bottom:18px; padding-left:18px\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnButtonContentContainer\" style=\"border-collapse:separate!important; border-radius:0px; background-color:#07BFD8\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"middle\" class=\"mcnButtonContent\" style=\"font-family:Arial; font-size:18px; padding:16px\">\r\n<a class=\"mcnButton \" title=\"How we built the Evernote Calendar Connector\" href=\"http://cronofy.us7.list-manage.com/track/click?u=1557eba245366dbf2346b5390&amp;id=492112618c&amp;e=edda950f1d\" target=\"_blank\" style=\"font-weight:bold; letter-spacing:normal; line-height:100%; text-align:center; text-decoration:none; color:#FFFFFF; word-wrap:break-word\">Request\r\n your personalized demo</a> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnDividerBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"min-width:100%; padding:18px\">\r\n<table class=\"mcnDividerContent\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"min-width:100%; border-top:2px solid #EAEAEA; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td style=\"\"><span></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextBlockInner\" style=\"padding-top:9px\">\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextContentContainer\" style=\"max-width:100%; min-width:100%; border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"padding-top:0; padding-right:18px; padding-bottom:9px; padding-left:18px; color:#606060; font-family:Helvetica; font-size:15px; line-height:150%; text-align:left\">\r\n<h3 class=\"null\" style=\"text-align:center; margin:0; padding:0; display:block; font-family:Helvetica; font-size:18px; font-style:normal; font-weight:bold; line-height:125%; letter-spacing:-.5px; color:#606060!important\">\r\nReal-Time Scheduling by Cronofy</h3>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnCaptionBlock\" style=\"border-collapse:collapse\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" valign=\"top\" style=\"padding:9px\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionLeftContentOuter\" width=\"100%\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnCaptionLeftContentInner\" style=\"padding:0 9px\">\r\n<table align=\"right\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionLeftImageContentContainer\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionLeftImageContent\" valign=\"top\" style=\"\"><img alt=\"\" src=\"https://gallery.mailchimp.com/1557eba245366dbf2346b5390/images/b73029f7-9a4b-4196-bf32-a34717c1498e.jpg\" width=\"264\" class=\"mcnImage\" style=\"max-width:640px; border:0; outline:none; text-decoration:none; vertical-align:bottom\">\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionLeftTextContentContainer\" align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"264\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"color:#606060; font-family:Helvetica; font-size:15px; line-height:150%; text-align:left\">\r\n<h3 class=\"null\" style=\"margin:0; padding:0; display:block; font-family:Helvetica; font-size:18px; font-style:normal; font-weight:bold; line-height:125%; letter-spacing:-.5px; text-align:left; color:#606060!important\">\r\nImprove your booking system</h3>\r\n<br>\r\nWith Real-Time Scheduling offer a new premium feature to your users. They can send booking links to reduce the number of no-shows and improve the booking experience.<br>\r\n<br>\r\n<a href=\"http://cronofy.us7.list-manage.com/track/click?u=1557eba245366dbf2346b5390&amp;id=b80c89b799&amp;e=edda950f1d\" target=\"_blank\" style=\"word-wrap:break-word; color:#6DC6DD; font-weight:normal; text-decoration:underline\">Read more</a>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnCaptionBlock\" style=\"border-collapse:collapse\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" valign=\"top\" style=\"padding:9px\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionRightContentOuter\" width=\"100%\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnCaptionRightContentInner\" style=\"padding:0 9px\">\r\n<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnCaptionRightImageContentContainer\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionRightImageContent\" valign=\"top\" style=\"\"><img alt=\"\" src=\"https://gallery.mailchimp.com/1557eba245366dbf2346b5390/images/4b0719f7-f1e2-4628-8fdd-85ce928ac8eb.jpg\" width=\"264\" class=\"mcnImage\" style=\"max-width:500px; border:0; outline:none; text-decoration:none; vertical-align:bottom\">\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionRightTextContentContainer\" align=\"right\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"264\" style=\"border-collapse:collapse\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" class=\"mcnTextContent\" style=\"color:#606060; font-family:Helvetica; font-size:15px; line-height:150%; text-align:left\">\r\n<h3 class=\"null\" style=\"margin:0; padding:0; display:block; font-family:Helvetica; font-size:18px; font-style:normal; font-weight:bold; line-height:125%; letter-spacing:-.5px; text-align:left; color:#606060!important\">\r\nGet started today</h3>\r\n<br>\r\nTake a look at our Real-Time Scheduling guide and learn how you can generate self-serve booking links for all types of appointments.<br>\r\n<br>\r\n<a href=\"http://cronofy.us7.list-manage1.com/track/click?u=1557eba245366dbf2346b5390&amp;id=8782c193d5&amp;e=edda950f1d\" target=\"_blank\" style=\"word-wrap:break-word; color:#6DC6DD; font-weight:normal; text-decoration:underline\">Continue reading</a>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnDividerBlock\" style=\"min-width:100%; border-collapse:collapse\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n